import React from 'react';
import { View, Text, Image, } from 'react-native';
import Icon from '../assets/Food.png';
import { MaterialIcons } from '@expo/vector-icons';

function Cart(props) {
    return (
        <View style={{
            height: 190,
            margin: 10,

            shadowOffset: {
                height: 1,
                width: 1,
            },
            shadowColor: "black",
            shadowRadius: 10,
            elevation: 10,
            shadowOpacity: .5,
            borderRadius: 10,
            padding: 10,
            flexDirection: 'row',
            backgroundColor: 'white',
        }}>
            <View style={{
                alignItems: 'center',
                flex:2,
                height: '100%',
                
                justifyContent: 'center',
                alignItems: 'center',


            }}>
                <Image style={{
                    height: 100,
                    width: 100,
                }} source={Icon} />
            </View>
            <View style={{
               flex:3,
                margin: 10,
            }}>
                <Text style={{
                    fontSize: 15,
                    fontWeight: '500',


                }}>
                    Multiple fast food item
                </Text>
                <Text style={{
                    fontSize: 10,
                    fontWeight: 'normal',
                    marginTop:5,
                    


                }}>
                    This food item is offering at your service, you can buy it instantly.
                </Text>
                <View style={{
                    flexDirection:'row',
                }}>
                <MaterialIcons name="directions-railway" size={15} color="black" /> 
                    <Text>
                        hi
                    </Text>
                </View>
            </View>

        </View>
    );
}

export default Cart;
